import React, { useRef, useEffect, useCallback, useState } from "react";
import { useDispatch } from "react-redux";
import { useSpring, animated } from "react-spring";
import toast from "toasted-notes";
import Cookies from "universal-cookie";
import {
  Background,
  ModalWrapper,
  ModalCotent,
  CloseModal,
} from "../../../styledComponents/Dashboard/Modals/createProjectsModal";

const CreateProject = (props) => {
  const closeModal = () => {
    props.setState((prevState) => ({
      ...prevState,
      CreateProjectModal: !props.state.CreateProjectModal,
    }));
  };
  return (
    <div>
      <Background>
        <ModalWrapper>
          <ModalCotent>
            <h1 className="header">Create Projects</h1>
            <div className="uservalue">
              <form>
                <label>Project name</label>
                <input
                  type="text"
                  name="projects_name"
                  placeholder="projects name"
                />
                <label>Alias name</label>
                <input type="text" name="alias_name" placeholder="Alias name" />
                {/* <label>Transaction type</label>
                    <select name="transaction_type" onChange={handleSubmit}>
                      <option value="select">Select</option>
                      <option value="income">Income</option>
                      <option value="expenditure">Expenditure</option>
                    </select> */}

                <div className="buttons">
                  <button
                    className="create"
                    onClick={(e) => {
                      e.preventDefault();
                    }}
                  >
                    Create Transaction
                  </button>
                  <button
                    className="cancel"
                    onClick={(e) => {
                      e.preventDefault();
                      closeModal();
                    }}
                  >
                    Cancel
                  </button>
                </div>
              </form>
            </div>
          </ModalCotent>
          <CloseModal
            onClick={() => {
              closeModal();
            }}
          >
            &times;
          </CloseModal>
        </ModalWrapper>
      </Background>
    </div>
  );
};

export default CreateProject;
